import React from 'react';

function AppContact(){
    return (
        <div className = "block contactBlock">
            <div className = "container-fluid">
                <div className = "titleHolder">
                    <h2><strong>CONTACT US </strong></h2>
                    <p><strong> You can contact us with ur
                        meesage written below. We will respond you either
                        by sending you email or making a call in 
                        your number</strong></p>
                </div>
            </div>
        </div>
    );
}

export default AppContact;
